import React, { useState } from 'react';
import './AdvertisingPortal.css';

const AdvertisingPortal = () => {
  const [adType, setAdType] = useState('');
  const [selectedVideo, setSelectedVideo] = useState(null);
  const [selectedImage, setSelectedImage] = useState(null);

  const handleAdTypeChange = (type) => {
    setAdType(type);
    setSelectedVideo(null);
    setSelectedImage(null);
  };

  const handleVideoUpload = (event) => {
    if (event.target.files && event.target.files[0]) {
      setSelectedVideo(event.target.files[0]);
    }
  };

  const handleImageUpload = (event) => {
    if (event.target.files && event.target.files[0]) {
      setSelectedImage(event.target.files[0]);
    }
  };
  return (
    <div className="advertising-portal-container">
      <h1 className="ad-portal-heading">Advertising Portal</h1>
      <h2 className="ad-portal-subheading">Select Ad Type</h2>
      <div className="ad-type-selection">
        <label>
          <input
            type="radio"
            value="video"
            checked={adType === 'video'}
            onChange={() => handleAdTypeChange('video')}
          />
          Video Ad
        </label>
        <label>
          <input
            type="radio"
            value="banner"
            checked={adType === 'banner'}
            onChange={() => handleAdTypeChange('banner')}
          />
          Banner Ad
        </label>
      </div>

      <h2>Define Target Audience</h2>
      <div>
        <label>Age:</label>
        <input type="number" placeholder="Min" className="form-control" /> - <input type="number" placeholder="Max" className="form-control" />
      </div>
      <div>
        <label>Gender:</label>
        <select className="form-control">
          <option>Male</option>
          <option>Female</option>
        </select>
      </div>

      <h2>Upload/Create Ad Creative</h2>
      {adType === 'video' && (
        <div>
          <label>Upload Video Ad:</label>
          <input type="file" className="form-control" onChange={handleVideoUpload} accept="video/*" />
        </div>
      )}
      {adType === 'banner' && (
        <div>
          <label>Upload Banner Ad:</label>
          <input type="file" className="form-control" onChange={handleImageUpload} accept="image/*" />
        </div>
      )}
      <div>
        <button className="btn btn-secondary">Create Basic Banner Ad</button>
      </div>

      <h2>Set Budget and Schedule</h2>
      <div>
        <label>Budget:</label>
        <input type="number" placeholder="Daily Budget" className="form-control"/>
      </div>
      <div>
        <label>Schedule:</label>
        <input type="date" className="form-control"/> - <input type="date" className="form-control" />
      </div>

      <h2>Preview Ad Placement</h2>
      {adType === 'video' && selectedVideo && (
        <div className="ad-preview">
          <video src={URL.createObjectURL(selectedVideo)} width="300" height="250" controls className="ad-video"></video>
          <p className="ad-text">Video Ad Preview</p>
        </div>
      )}
      {adType === 'banner' && (
        <div className="ad-preview">
          <img src="https://via.placeholder.com/300x250" alt="Ad Preview" className="ad-image" />
          <p className="ad-text">Banner Ad Preview</p>
        </div>
      )}

      <h2>Submit Campaign for Review</h2>

        <button className="btn btn-primary">Submit Campaign</button>

      <h2>Manage Existing Campaigns</h2>
      {/* Add manage campaigns UI here */}

    </div>
  );
};

export default AdvertisingPortal;
